-- Volcando estructura para función rvinventory.getDayNameSpanish
DELIMITER //
CREATE FUNCTION `getDayNameSpanish`(
	`fechaIN` DATETIME
) RETURNS varchar(30) CHARSET utf8mb4
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE salida VARCHAR(30);
    SELECT CASE DAYOFWEEK(fechaIN)
    WHEN 1 THEN "Domingo"
    WHEN 2 THEN "Lunes"
    WHEN 3 THEN "Martes"
    WHEN 4 THEN "Miercoles"
    WHEN 5 THEN "Jueves"
    WHEN 6 THEN "Viernes"
    WHEN 7 THEN "Sabado" END
    INTO @salida;
    
  RETURN @salida;
END//
DELIMITER ;

