SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `asignaciones_after_delete` AFTER DELETE ON `asignaciones` FOR EACH ROW BEGIN
DECLARE SerieModelo VARCHAR(50);
DECLARE Marca VARCHAR(50);
DECLARE Modelo VARCHAR(50);
DECLARE Empleado VARCHAR(50);

SET @SerieModelo = (SELECT B.Respuesta FROM caracteristica AS A 
JOIN caracteristicarespuesta AS B
ON A.IdCategoria = B.IdCategoria AND A.IdCaracteristica = B.IdCaracteristica
WHERE A.IdCategoria = 1 AND A.IdCaracteristica = 6 AND B.IdEquipoIngresado = OLD.IdEquipo); 

SET @Marca = (SELECT B.Respuesta FROM caracteristica AS A 
JOIN caracteristicarespuesta AS B
ON A.IdCategoria = B.IdCategoria AND A.IdCaracteristica = B.IdCaracteristica
WHERE A.IdCategoria = 1 AND A.IdCaracteristica = 1 AND B.IdEquipoIngresado = OLD.IdEquipo); 

SET @Modelo = (SELECT B.Respuesta FROM caracteristica AS A 
JOIN caracteristicarespuesta AS B
ON A.IdCategoria = B.IdCategoria AND A.IdCaracteristica = B.IdCaracteristica
WHERE A.IdCategoria = 1 AND A.IdCaracteristica = 3 AND B.IdEquipoIngresado = OLD.IdEquipo); 

SET @Empleado = (SELECT NombreEmpleado FROM empleados WHERE IdEmpleado = OLD.IdEmpleado); 

INSERT INTO bitacora(Accion, Modulo) VALUES(CONCAT("Se quita asignacion de equipo ",@SerieModelo, " ", @Marca, " ",@Modelo, " a ", @Empleado),"Asignaciones");
END//
